const uuid = __webpack_require__(/*! uuid/v4 */ "./node_modules/uuid/v4.js")
const fs = __webpack_require__(/*! uxp */ "uxp").storage.localFileSystem;

module.exports = {
    name: "get",
    async action(context) {
        const dataFolder = await fs.getDataFolder();
        
        // Get tokens folder or create it
        const tokensFolder = await findTokensFolderInsideDataFolder(dataFolder)
        context.rootState.tokensFolder = tokensFolder;
        
        // Get collections
        let collections = await getCollectionsFromFolder(tokensFolder)
        collections = collections.sort((a, b) => {
            return a.name.toLowerCase() > b.name.toLowerCase() ? 1 : -1;
        });
        context.rootState.collections = collections

        if (collections.length) {
            let selectedID = context.rootState.settings.selectedCollection

            if (selectedID == "CREATE_THEME" && context.rootState.collections.length) {
                selectedID = context.rootState.collections[0].id
            }
            context.dispatch("sort")
            context.dispatch("select", {
                id: selectedID
            })

            hydrate(context)
        } else {
            // await context.dispatch("createDefault")
            // await context.dispatch("select", {id: null})
        }

        
    }
}
/**
 * Adds missing IDs to legacy files
 * IDs have been introduced in 0.1.7
 */
function hydrate(context) {
    let didHydrate = false
    context.rootState.collections.map(collection => {
        if (!collection.id) {
            collection.id = uuid()
            didHydrate = true
        }
    })
    if (didHydrate) context.dispatch("save")

}

async function findTokensFolderInsideDataFolder(dataFolder) {    
    const entries = await dataFolder.getEntries();
    let folder = null;
    await Promise.all(
        entries.map(async entry => {
            if (entry.isFolder) {
                if (entry.name == "tokens") {
                    folder = entry
                }
            }
        })
    );
    if (!folder) {
        folder = await dataFolder.createFolder("tokens");
    }
    return folder
}

async function getCollectionsFromFolder(folder) {
    let files = await folder.getEntries();
    let collections = []
    await Promise.all(
        files.map(async file => {
            if (file.name.indexOf("json") != -1) {
                let content = JSON.parse(await file.read());
                collections.push({
                    filename: file.name,
                    file: file,
                    name: content.name || "Unknown",
                    id: content.id,
                    tokens: content.tokens || {}
                });
            }
        })
    );
    return collections
}


